import { makeStyles } from '@mui/styles';

export default makeStyles((theme) => ({
    paper: {
        overflow: 'auto',
        paddingBottom: 50,
        paddingLeft: 50,
        paddingRight: 50,
        fontFamily: 'sans-serif'
    }
}));
